
def ReverseComplement(Pattern):
    """get the complimentary DNA 
        sequence given in Pattern"""

    def Complimentary(i):
        switcher = {
            "A": "T",
            "T": "A",
            "G": "C",
            "C": "G"
        }
        return switcher.get(i)

    reverseText = ""
    for i in range(len(Pattern)):
        reverseText += Pattern[len(Pattern)-(i+1)]
    complimentText = ""
    for i in reverseText:
        complimentText += Complimentary(i)
    return complimentText


